query GetModelViewPrefetch($modelId: ID!, $includeDisabled: Boolean!) {
  model(id: $modelId) {
    id
    mattertags(includeDisabled: $includeDisabled) {
      ...MattertagDetails
      __typename
    }
    orderedLists(ids: []) {
      ...OrderedListDetails
      __typename
    }
    labels(includeDisabled: $includeDisabled) {
      ...LabelDetails
      __typename
    }
    measurementPaths(includeDisabled: $includeDisabled) {
      ...MeasurementDetails
      __typename
    }
    activeHighlightReel {
      ...HighlightReelDetails
      __typename
    }
    notes(ids: []) {
      ...NoteDetails
      __typename
    }
    image {
      ...PhotoDetails
      __typename
    }
    __typename
  }
}

fragment MattertagDetails on Mattertag {
  id
  label
  description
  color
  enabled
  floor {
    id
    meshId
    __typename
  }
  room {
    id
    meshId
    __typename
  }
  anchorPosition {
    x
    y
    z
    __typename
  }
  stemEnabled
  stemNormal {
    x
    y
    z
    __typename
  }
  stemLength
  media
  mediaType
  created
  modified
  externalAttachments {
    ...ExternalAttachmentDetails
    __typename
  }
  fileAttachments {
    ...FileAttachmentDetails
    __typename
  }
  objectAnnotation {
    id
    classification {
      defaultKeywords
      __typename
    }
    __typename
  }
  keywords
  icon
  __typename
}

fragment OrderedListDetails on OrderedList {
  id
  label
  entries {
    ...EntryDetails
    __typename
  }
  __typename
}

fragment LabelDetails on Label {
  id
  position {
    x
    y
    z
    __typename
  }
  floor {
    id
    meshId
    __typename
  }
  room {
    id
    meshId
    __typename
  }
  label
  enabled
  created
  modified
  __typename
}

fragment MeasurementDetails on MeasurementPath {
  id
  lineType
  label
  enabled
  points {
    position {
      x
      y
      z
      __typename
    }
    floor {
      id
      meshId
      __typename
    }
    room {
      id
      meshId
      __typename
    }
    __typename
  }
  created
  modified
  __typename
}

fragment HighlightReelDetails on HighlightReel {
  id
  label
  mode
  reel {
    overrides {
      transitionType
      panDirection
      panAngle
      __typename
    }
    asset {
      ... on Photo {
        id
        __typename
      }
      __typename
    }
    title
    description
    __typename
  }
  __typename
}

fragment NoteDetails on Note {
  id
  createdBy {
    id
    firstName
    lastName
    email
    __typename
  }
  color
  enabled
  floor {
    id
    meshId
    __typename
  }
  room {
    id
    meshId
    __typename
  }
  anchorPosition {
    x
    y
    z
    __typename
  }
  stemEnabled
  stemNormal {
    x
    y
    z
    __typename
  }
  stemLength
  resolution
  created
  modified
  lastCommentAt
  comments {
    results {
      ...CommentDetails
      __typename
    }
    __typename
  }
  __typename
}

fragment PhotoDetails on Photo {
  id
  label
  classification
  category
  height
  width
  created
  modified
  status
  filename
  format
  url
  resolutions
  type
  origin
  validUntil
  thumbnailUrl: resizeUrl(resolution: thumbnail)
  presentationUrl: resizeUrl(resolution: presentation)
  snapshotLocation {
    viewMode
    position {
      x
      y
      z
      __typename
    }
    rotation {
      x
      y
      z
      w
      __typename
    }
    zoom
    floorVisibility {
      id
      meshId
      sequence
      __typename
    }
    anchor {
      id
      pano {
        id
        placement
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment ExternalAttachmentDetails on ExternalAttachment {
  id
  created
  modified
  thumbnailUrl
  url
  mediaType
  width
  height
  category
  parentDetails {
    type
    parent {
      id
      __typename
    }
    __typename
  }
  __typename
}

fragment FileAttachmentDetails on FileAttachment {
  id
  created
  filename
  url
  validUntil
  bytes
  mimeType
  ... on ImageFileAttachment {
    imageWidth
    imageHeight
    __typename
  }
  __typename
}

fragment EntryDetails on Entry {
  id
  type
  __typename
}

fragment CommentDetails on Comment {
  id
  created
  modified
  edited
  text
  createdBy {
    id
    firstName
    lastName
    email
    __typename
  }
  externalAttachments {
    ...ExternalAttachmentDetails
    __typename
  }
  fileAttachments {
    ...FileAttachmentDetails
    __typename
  }
  __typename
}
